import React from "react";
import "./LandingPage.css";
import { Header, Hero, StatisticsSection } from "../../components";
import "./LandingPage.css";

function LandingPage() {
  return (
    <div>
      <div>
        <div className="main">
          <div className="container">
            <Header />
            <Hero />
          </div>
        </div>
      </div>
      <StatisticsSection />
    </div>
  );
}

export default LandingPage;
